import React, { Component } from "react";
import { Card, CardText, CardTitle } from "reactstrap";
import Header from "../../component/header";
import CardComponent from "./CardComponent";
class Home extends Component {
  render() {
    return (
      <div>
        <Header>
          <Card body className="text-center">
            <CardTitle>Web Application</CardTitle>
            <CardText>
              <CardComponent time="Items" title="This items" desc="items" />
              <CardComponent time="Units" title="This is Units" desc="units" />
              <CardComponent
                time="Transactions"
                title="This is transactions"
                desc="transactions"
              />
              <CardComponent
                time="Stocks"
                title="This is stocks"
                desc="transactions"
              />
            </CardText>
          </Card>
        </Header>
      </div>
    );
  }
}

export default Home;
